const DemendeValidateUser = async (credentiel)=>{
    const response = await fetch("http://127.0.0.1:8000/api/validate/",{
        method: 'POST',
        headers:{
            'Content-Type': 'application/json'
        },
        body:  JSON.stringify(credentiel)
    });
    return await response.json();
}

export default DemendeValidateUser
